import React from "react";

export default class MundialQatarPagina extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            Mundial: []
        }

    }
    componentDidMount() {
        fetch("https://api.football-data.org/v2/competitions/CUP/matches?status=SCHEDULED", {
            method: "GET",
            headers: {
                "X-Auth-Token": "130849e0ce064febb45c9991f11c78a6"
            },
        })
            .then((res) => res.json())
            .then((data) => {
                this.setState({
                    Mundial: data.matches
                })
            })
            .catch((err) => console.log(err))
    }

    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col">
                        <h1>Pr√≥ximos Partidos de la Champions League</h1>
                        <table className="table table-striped">
                            <thead>
                                <tr>
                                    <th scope="col">Fecha</th>
                                    <th scope="col">Local</th>
                                    <th scope="col">Visitante</th>
                                </tr>
                            </thead>
                            <tbody>
                                {this.state.Mundial.map((partido) => (
                                    <tr>
                                        <td>{partido.utcDate}</td>
                                        <td>{partido.homeTeam.name}</td>
                                        <td>{partido.awayTeam.name}</td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                </div>
            </div>
        )   
}
}
